import React, { useContext, useEffect } from 'react'
import { Container } from 'react-bootstrap'
import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";
// import FormTitle from "../components/FormTitle";
import { useState } from "react";
import toast from 'react-hot-toast'
// import { signup } from "../services/apiServices";
import { useNavigate } from "react-router-dom";
import { UserContext } from '../../context/userContext';
type Props = {}

const Profile = (props: Props) => {
   const navigate = useNavigate();
  const [firstName, setFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [email, setEmail] = useState("");
  const [phone, setPhone] = useState("");
  const [password, setPassword] = useState("");
  const [address, setAddress] = useState("");
const { userData } = useContext(UserContext);

    useEffect(() => {

    console.log(userData?.user);


    // setName(name);
    // setEmail(email);
    // setPhone(phone);
    // setAddress(address);
  }, [userData]);

  return (
    <Container className='d-flex'>
      <Container className='p-4'>
<div className='d-flex justify-content-center'>
        <img className='w-50' src={'data:image/jpeg;base64,'} alt="" />
        </div>
        <h3 className='text-center'>name</h3>
        <h6 className='text-center text-muted '>email@gmail.com</h6>
      </Container>
      <Container>
          <Form className="w-100 p-4">
      {/* <FormTitle mainText="Sign up below" subText="join now!" /> */}

      <Form.Group className="mb-3" controlId="formBasicFname">
        <Form.Label>
          First name <span className="text-danger">*</span>
        </Form.Label>
        <Form.Control
          value={firstName}
          onChange={(e) => setFirstName(e.target.value)}
          type="text"
        />
      </Form.Group>

      <Form.Group className="mb-3" controlId="formBasicLname">
        <Form.Label>
          Last name <span className="text-muted">(optional)</span>
        </Form.Label>
        <Form.Control
          value={lastName}
          onChange={(e) => setLastName(e.target.value)}
          type="text"
        />
      </Form.Group>

      <Form.Group className="mb-3" controlId="formBasicEmail">
        <Form.Label>
          Email <span className="text-danger">*</span>
        </Form.Label>
        <Form.Control
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          type="email"
        />
      </Form.Group>

      <Form.Group className="mb-3" controlId="formBasicPassword">
        <Form.Label>
          Password <span className="text-danger">*</span>
        </Form.Label>
        <Form.Control
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          type="password"
        />
      </Form.Group>

      <Form.Group className="mb-3" controlId="formBasicPhone">
        <Form.Label>
          Phone <span className="text-danger">*</span>
        </Form.Label>
        <Form.Control
          value={phone}
          onChange={(e) => setPhone(e.target.value)}
          type="text"
        />
      </Form.Group>

      <Form.Group className="mb-3" controlId="formBasicAddress">
        <Form.Label>
          Address <span className="text-danger">*</span>
        </Form.Label>
        <Form.Control
          value={address}
          onChange={(e) => setAddress(e.target.value)}
          type="text"
        />
      </Form.Group>

      <Button  variant="outline-primary" type="button">
        UPDATE
      </Button>
    </Form>
      </Container>
    </Container>
  )
}

export default Profile
